import logements from '../../assets/data/logements.json'
import Card from ""

function Main() {
     return (
          <div className="card-container">
               <ul className="liste-cards">
                    {logements.map((cover, title, id) => (
                        <li className="liste-card">
                             <Card cover={cover} title={title} id={id} />
                        </li>
                    ))}
               </ul>
          </div>
     )
}

export default Main
